"use strict";

$(function () {
  window.hackstack = window.hackstack || {};

  (function (hackstack) {
    // create the components
    var navbar = new HackStackNavBar("inventoryReport");
    var footer = new HackStackFooter(); // render the components

    $("#navbar").append(navbar.render());
    $("#footer").append(footer.render());
    $.get(hackstack.API_SERVER + "/generate/inventoryReport", function (data) {
      $("#inventoryReport").attr("src", hackstack.API_SERVER + data);
    });
  })(window.hackstack);
});
